            ],
            style: ["pdfLabel"],
            alignment: "left",
          },
          {
            text: [
              { text: "-Solicitante: ", bold: true },
              `${this.limitName(task.data[0].idTarefaFK.idSolicitanteFK.nome)}`,
            ],
            style: ["pdfLabel"],
            alignment: "left",
          },
          {
            text: printResponsibleNames(task.data, this.limitName),
            style: ["pdfLabel"],
            alignment: "left",
          },
          {
            text: " ",
            alignment: "center",
          },
          {
            text: "Progresso da Tarefa",
            style: ["pdfSubTitle2"],
          },
          {
            text: "Aberta",
            style: ["pdfMiniLabel", "defaultColor2"],
