            absolutePosition: { x: 65, y: 355 },
          },
          {
            text: "Em andamento",
            style: ["pdfMiniLabel", "defaultColor2"],
            absolutePosition: { x: 195, y: 300 },
          },
          {
            svg: timelineSvgs[1],
            width: 25,
            height: 25,
            absolutePosition: { x: 210, y: 320 },
          },
          {
            text: `${
              task.status.length > 1 ? this.formatDate(task.status[1].data) : ""
            }`,
            style: ["pdfMiniLabel"],
            absolutePosition: { x: 185, y: 355 },
          },
          {
            text: "Concluída",
            style: ["pdfMiniLabel", "defaultColor2"],
            absolutePosition: { x: 320, y: 300 },
          },
