      // this.filteredTasksIds = null;
    },
    searchTasksIds(event) {
      setTimeout(() => {
        if (!event.query.trim().length) {
          this.filteredTasksIds = [...this.allTasksIds];
        } else {
          this.filteredTasksIds = this.allTasksIds.filter((task) => {
