    getTasksUser: async function (tasks) {
      this.tasksPrint.length = 0;
      this.photos.length = 0;

      await Promise.all(
        tasks.map(async (id) => {
          await this.$axios
            .$get(
              this.$store.state.BASE_URL +
                ("tarefasUsuarios/?tarefaCompletaStatusPhoto=" + id)
            )
            .then((response) => {
              let photosArray = [[], []];

              //request ok
              if (response.data !== null && response.data !== undefined) {
                this.tasksPrint.push(structuredClone(response));

                response.photos.forEach((photo) => {
                  if (photo.idStatusFK !== 3)
                    photosArray[0].push(structuredClone(photo));
                  else photosArray[1].push(structuredClone(photo));

                  // console.log("imprimindo as fotos individuais...");
                  // console.log(photo);
                });
                this.photos.push(photosArray);
                return response;
              }
            })
            .catch((response) => {
              alert("Problema ao tentar pegar tarefa " + id);
              console.log(response);
            });
        })
      );

      console.log("final get task user");
      console.log(this.tasksPrint);
      console.log("photos");
      console.log(this.photos);
    },
    getAllTaskIds: async function () {
      this.$axios
        .$get(this.$store.state.BASE_URL + "tarefas/?ids=1")
        .then((response) => {
          //request ok
          if (response.data !== null && response.data !== undefined) {
            this.allTasksIds = structuredClone(response.data);

            console.log("this.allTasksIds");
            console.log(this.allTasksIds);
          }
        })
        .catch((response) => {
          alert("Problema ao tentar pegar tarefas Ids ");
          console.log(response);
        });
    },
  },
  created() {
    if (this.actualUser === null || this.actualUser === undefined)
      this.$router.push("/lobby");
    else {

      switch (this.$store.state.printMode) {
        case "dashboards":
          break;

        case "tasks":
          this.getAllTaskIds();
          this.showTasksToPrint = true;
          break;

        default:
          if (!this.$store.state.tasksToPrint.length) {
            // this.tasksPrintID.push(42);
            // this.tasksPrintID.push(43);
          } else this.tasksPrintID = this.$store.state.tasksToPrint;

          console.log("this.tasksPrintID");
          console.log(this.tasksPrintID);
          this.getTasksUser(this.tasksPrintID);

          break;
      }
      this.$store.dispatch("setPrintMode", "");
      this.$store.dispatch("setTaskToPrint", []);

    }
  },
  
};
</script>
